import React from "react";
import ProtoTypes from 'prop-types';

const AppLayout = ({ children }) => {
    return (
        <div>
            <div> 공통 메뉴 </div>
        { children }
        </div>
    )
};

AppLayout.propTypes = {
    children: ProtoTypes.node.isRequired,
};

export default AppLayout;
